script: |
  super -f text -I q3988.spq | sort > q3988.out

inputs:
  - name: q3988.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 / 64 + - col1 * col0 BETWEEN + 46 * col2 AND - col2;
  - name: tab1

outputs:
  - name: q3988.out
    data: |
      51	14	96
      85	5	59
      91	47	68
